import { Component } from "react";
export default class SingleImage extends Component {
  render() {
    return (
      <div className="city">
        <img src={this.props.imgSRC} />
        <p>City name: {this.props.detals.FullName}</p>
        <p>Continent :{this.props.detals.continent}</p>
        <p>
          Location :<p>{this.props.detals.boundingBox.east}</p>
          <p>{this.props.detals.boundingBox.north}</p>
          <p>{this.props.detals.boundingBox.south}</p>
          <p>{this.props.detals.boundingBox.west}</p>
        </p>
      </div>
    );
  }
}
